import React from "react";

import { FolderWindow } from "../FolderWindow";

export const App = ({ vocabulary }) => {
  return (
    <div>
      {vocabulary.map((folder, key) => (
        <FolderWindow key={key} folder={folder} />
      ))}
    </div>
  );
};
